pragma solidity ^0.8.0; // Указание версии компилятора

contract First_Contract {

    // Функция возвращает число
    function getANumber() public pure returns (uint256) {
        uint256 x = 1;
        return x;
    } 

    // Функция возвращает булево значение
    function getABoolean() public pure returns (bool) {
        bool y = true;
        return y;
    }

    // Функция возвращает адрес
    function getAnAddress() public pure returns (address) {
        return 0x7b5d2FEa6FAAAd4bE4ffCdBafcbbcC1b9EcdEAC5; // Чексумма исправлена
        
    }

}

